	function generatePageLink() {
		global $total;
		global $page;
		
		$previous = ($page - 14) + 1;
		if ($previous < 0) {
			$previous = 0;
		}
		
		// previous pages
		for ($i = $previous; $i < $page; $i++) {
			echo '<A CLASS="F2" HREF="/en/javagame/dust/search/n_2_0_a_1593529200_';
			echo $i;
			echo '.html">' . ($i + 1) . '</A> ';
		}
		
		// current page
		echo '<B CLASS="F2">' . ($page + 1) . '</B> ';
		
		// next pages
		$next = ($page + 14);
		if ($next > $total) {
			$next = $total;
		}
		for ($i = $page + 1; $i < $next; $i++) {
			echo '<A CLASS="F2" HREF="/en/javagame/dust/search/n_2_0_a_1593529200_';
			echo $i;
			echo '.html">' . ($i + 1) . '</A> ';
		}
	}
	
	function generateLevels() {
		global $levels;

		$comma = '';
		echo 'dust12_search(1,1,[';
		for ($i = 0; $i < count($levels); $i++) {
			$lvl = $levels[$i];
			
			$date = new DateTime($lvl['creation_date']);
			$date = $date->format('M d,Y H:i');
			
			echo $comma;
			echo $lvl['id'] . ',';
			echo "'" . unpack("H*", $lvl['title'])[1] . "',";
			echo "'" . unpack("H*", $lvl['author'])[1] . "',";
			echo $lvl['votes'] . ',';
			echo "'" . $date . "',";
			echo '0'; 	//	0=nothing, 1=new, 2=print BR
			$comma = ',';
		}
		echo ',],' . count($levels) . ');';
	}
